import { createSlice } from "@reduxjs/toolkit";

import {
  getAllProductsThunk,
} from "../Data/productThunk";

const initialState = {
  productList: [],
  };

const productSlice = createSlice({
  name: "productSlice",
  initialState,
  reducers: {},
});

export default productSlice.reducer;
